PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime, "profilepicture" blob, "admin" tinyint(1) not null default '0');
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "follows" ("who" integer not null, "whom" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("who") references "users"("id") on delete cascade, foreign key("whom") references "users"("id") on delete cascade, primary key ("who", "whom"));
CREATE TABLE IF NOT EXISTS "genres" ("id" integer primary key autoincrement not null, "name" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "stories" ("id" integer primary key autoincrement not null, "title" varchar not null, "slug" varchar not null, "content" text not null, "highlighted" tinyint(1) not null default '0', "author" integer not null, "likeCount" integer not null default '0', "genre" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("author") references "users"("id") on delete cascade, foreign key("genre") references "genres"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "likes" ("id" integer primary key autoincrement not null, "user_id" integer not null, "story_id" integer not null, "is_liked" tinyint(1) not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id"), foreign key("story_id") references "stories"("id"));
CREATE TABLE IF NOT EXISTS "genre_follows" ("who" integer not null, "which" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("who") references "users"("id") on delete cascade, foreign key("which") references "genres"("id") on delete cascade, primary key ("who", "which"));
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE UNIQUE INDEX "genres_name_unique" on "genres" ("name");
CREATE UNIQUE INDEX "stories_title_unique" on "stories" ("title");
CREATE UNIQUE INDEX "stories_slug_unique" on "stories" ("slug");
COMMIT;
